import { useState } from "react"

export default function Counter() {

    const [itemsTaken, setItemsTaken] = useState(0)

    return (
        <div className="counter">
            <svg className="counter--minus" xmlns="http://www.w3.org/2000/svg" width="7" height="2" viewBox="0 0 7 2">
                <line id="Линия_1" data-name="Линия 1" x2="5" transform="translate(1 1)" fill="none" stroke="#fff" strokeLinecap="round" stroke-width="2"/>
            </svg>
            <span className="counter--number">{itemsTaken}</span>
            <svg className="counter--plus" xmlns="http://www.w3.org/2000/svg" width="9" height="9" viewBox="0 0 9 9">
                <line id="Линия_3" data-name="Линия 3" x2="7" transform="translate(1 4.5)" fill="none" stroke="#fff" stroke-linecap="round" stroke-width="2"/>
